[Form]
public class BusinessDocumentParameters extends FormRun
{
    #ISOCountryRegionCodes

    private const str ChorusProSubmissionReportModelName = "DocumentSubmitted";
    private const str ChorusProSubmissionReportDefinitionName = "SubmittedInvoice";
    private BusinessDocumentChorusProCacheManagerService_FR cacheManager;
}

public void init()
{
    super();

    #SysSystemDefinedButtons

    BusinessDocumentParameters::find();

    this.initTabPagesVisibility();
    this.initFeaturesTab();
    this.initDataverseTab();
    this.initSubmissionServiceTabPage();
    this.initChorusProTabPage();

    EmailParameters.visible(BusinessDocumentParameters::isFeatureEnabled([EInvoicingFeaturesForService::BR00053]));

    if (FeatureStateProvider::isFeatureEnabled(ERForInvoicingFeatureDesignerWorkspaceFeature::instance()))
    {
        var saveButton = this.control(this.controlId(#SystemDefinedSaveButton)) as FormCommandButtonControl;
        saveButton.registerOverrideMethod(
            methodStr(FormCommandButtonControl, clicked),
            formMethodStr(BusinessDocumentParameters, saveEventHandler),
            this);
    }

    if (FeatureStateProvider::isFeatureEnabled(BusinessDocumentBatchSubmissionFeature::instance()))
    {
        businessDocumentTypes_ds.object(fieldNum(BusinessDocumentTypes, CDSIntegration)).visible(false);
    }
}

private void saveEventHandler(FormCommandButtonControl _formButtonControl)
{
    _formButtonControl.clicked();

    if (EInvoicingParametersFormPart.isDisplayed())
    {
        var publishable = EInvoicingParametersFormPart.getPartFormRun() as ERIForInvoicingPublishable;
        if (publishable)
        {
            publishable.publishInvoicingParameters();
        }
    }
}

private void initTabPagesVisibility()
{
    var isGlobalizationFeatureEnabled =  FeatureStateProvider::isFeatureEnabled(ERForInvoicingFeatureDesignerWorkspaceFeature::instance());
    EInvoicingParametersTabPage.visible(isGlobalizationFeatureEnabled);
    SubmissionServiceTabPage.visible(!isGlobalizationFeatureEnabled);
}

private void initSubmissionServiceTabPage()
{
    #ISOCountryRegionCodes
    if (SubmissionServiceTabPage.isVisible())
    {
        var endpointFromConfiguration = SysHttpCommunicationEnvironmentSettings::getMicroservicesApiEndpoint();

        if (endpointFromConfiguration && !BusinessDocumentServiceEndpointEditabilityFlight::instance().isEnabled())
        {
            BusinessDocServiceEndpointFromConfiguration.text(BusinessDocumentServiceController::serviceVanityEndpoint());
            BusinessDocServiceEndpointFromConfiguration.visible(true);
            BusinessDocServiceEndpoint.visible(false);
        }

        businessDocumentParameters_ds.object(fieldNum(BusinessDocumentParameters, SubscriptionId)).enabled(ERInvoicingServiceAxMigrationDetails::canEnvironmentNameBeEdited());
    }
}

private void initDataverseTab()
{
DataverseIntegraionTabPage.visible(false);
}

private void initFeaturesTab()
{
    boolean isFeatureEnabled = ElectronicInvoicingServiceIntegrationFeature::isEnabled();
    EInvoicingFeaturesTabPage.visible(isFeatureEnabled);

    if (isFeatureEnabled)
    {
        EInvoicingFeaturesForServiceTmp.initTable();
    }

}

private void initChorusProTabPage()
{
    if (FeatureStateProvider::IsFeatureEnabled(BusinessDocChorusProInvoicingIntegrationFeature_FR::instance()))
    {
        BusinessDocChorusProParameters_FR::find();
        ChorusProIntegrationTabPage.visible(true);
        cacheManager = BusinessDocumentChorusProCacheManagerService_FR::construct();
    }
    else
    {
        ChorusProIntegrationTabPage.visible(false);
    }
}

