public boolean validate()
{
    boolean ret = super();

    if (ret)
    {
        ret = NumberSequenceTable::checkExistByNaturalKey(NumberSequenceTable::find(businessDocumentTypes.FileNameNumberSeq).NumberSequence, NumberSeqScopeFactory::createDataAreaScope().getId());
    }

    return ret;
}

public void modified()
{
    super();

    BusinessDocumentParameters.updateEnabledFeatures(EInvoicingFeaturesForServiceTmp);

    if(eInvoicingFeaturesForServiceTmp.Feature == EInvoicingFeaturesForService::BR00053)
    {
        EmailParameters.visible(eInvoicingFeaturesForServiceTmp.Enabled);
    }
}

public int active()
{
    int ret = super();

    OutgoingVariables.enabled(externalAgents.ChannelType == BusinessDocumentChannelType::Import);

    return ret;
}

